import React, {useEffect, useState} from 'react';
import DashBoard  from './components/dashBoard'; 
import axios from "axios";

const api = {
  url: "https://dev.geo.sdis67.com/api/v1/public/allUsers"
};
function App() {
  const [ApiData, setApiData]= useState(null)
  const getAPIData = async () => {
    const res = await axios.get(`${api.url}?group=maire`);
    setApiData(res.data)
  };
  useEffect(() => {
    console.log("getapi");
    getAPIData();
  }, []);
  console.warn("debugApiData", ApiData);
  return (
    <div className="App">
      <DashBoard api= {ApiData} />
    </div>
  );
}

export default App;
